import { Tree } from 'antd';
import React from 'react';


class TreeItem extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
        < span color = "red" >
            { this.props.totaldesc }
    </span >
    )
}
}

export default TreeItem;
